  ngOnInit(): void {
    this.cropwidth = this.rating*90/5;
    // console.log( `rating is ${this.rating}` );
  }
  onClick(){
    this.ratingClicked.emit( `rating is ${this.rating}` );
  }
  public get classes(): Array<string> {
    return ['star', `${this.color}-star`];
  }


}

